const Leaderboard=(props)=>{
    return(
        <table class="table">
        <thead>
            <tr>
                <th>Users</th>
                <th>Answer</th>
                <th>Created</th>
                <th></th>
            </tr>
        </thead>
        <tbody> 
            @foreach (var student in Model)
            {   
                    <tr>
                    <td>@student.Id</td>
                    <td>@student.Name</td>
                    <td>@student.Email</td>
                    
                </tr>
            }
        </tbody>
    </table>
    )
}
const mapStateToProps = ({ questions,users}) => {
    return {
       
        questions,
        users,
    };
};
export default connect(mapStateToProps)(Leaderboard);
